const AvailableMeals = () => {
  const [availableMeals, setAvailableMeals] = useState([]);

  function fetchMeals() {
    fetch("https://react-hooks-7f7ca-default-rtdb.firebaseio.com/meals")
      .then((response) => {
        return response.json();
      })
      .then((data) => { 
        const mealsList = data.map((meal) => {
            return (
              <MealItem
                id={meal.id}
                key={meal.id}
                name={meal.name}
                description={meal.description}
                price={meal.price}
              />
            );
        } )         
       setAvailableMeals(mealsList);
      });
  }
    const mealsList = DUMMY_MEALS.map((meal) => (
    <MealItem
      key={meal.id}
      id={meal.id}
      name={meal.name}
      description={meal.description}
      price={meal.price}
    />
  ));

  return (
    <section className={styles.meals}>
      <Card>
        <ul>{availableMeals}</ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
